import React from 'react';

const Button = ({ name }) => {
  return <button className=" py-2 px-4 bg-gray-200 hover:bg-gray-300 rounded cursor-pointer transition duration-200 ease-in-out w-full text-left">{name}</button>;
}

export default Button;
